import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";
import "./App.css";
// import img1 from "./img/Amul Bread.png";
// import img2 from "./img/Amul Butter.jpeg";
// import img3 from "./img/Amul Cheese.jpeg";
// import img4 from "./img/Amul Combo.png";
// import img5 from "./img/Amul Milk .jpeg";
// import img6 from "./img/Kissan Jam.jpeg";
import ProductCard from "./ProductCard";

const Products = [{"name":"Amul Bread", "price":"320", "img": "https://m.media-amazon.com/images/I/31jnbQQT3uS._SY300_SX300_QL70_FMwebp_.jpg"}, {"name":"Amul Butter", "price":"320", "img": "./img/Amul Butter.png"} ]


function Homee(){

  const [products, setproducts] = useState([]);

  const fetchData = () => {
    return fetch("https://jsonplaceholder.typicode.com/users")
          .then((response) => response.json())
          .then((data) => setproducts(data));
  }

  useEffect(() => {
    fetchData();
  },[])

  return (
    <div className="homediv d-flex flex-row align-items-stretch">
      <div className="row">

        {
          products.map((pr)=>(
            <ProductCard name={pr.name} img={pr.img} price={pr.price}/>
          ))
        }


      </div>
    </div>
    );
}

export default Homee;
